import styled from 'styled-components'
import '../styles/theme.css'

const Main = ({ className, children, header }) => (
    <MainStyles className={className}>
        <h2>{header}</h2>
        <div></div>
      {children}
    </MainStyles>
  );

  const MainStyles = styled('div')`
    background: var(--gray100);
    grid-column-start: 3;
    height: 100vh;
    padding: 1.5em 2em;
  `;

export default Main;
